import React, { useState } from "react";
import './header.css'

export default function Header() {
    const [theme, setTheme] = useState("light");

    const handleClick = () => {
        setTheme(theme === "light" ? "dark" : "light");
    }
    return (
        <header>
            <img src="" alt="Logo GIFOS" />
            <button type="button" onClick={handleClick}>Modo {theme}</button>
        </header>
    )
}
